input = ""

class Ring:
    def __init__(self, size):
        self.buf = [None] * size
        self.size = size
        self.cursor = 0

    def insert(self, elem):
        self.cursor += 1
        index = self.cursor % self.size
        self.buf[index] = elem

    def contains_only_unique_elems(self):
        for elem in self.buf:
            if elem is None:
                return False

        return len(set(self.buf)) == self.size

def run():
    r = Ring(14)
    for e in list(input):
        r.insert(e)
        if r.contains_only_unique_elems():
            print(r.cursor)
            break

